import styled from 'styled-components'
import Carousel from 'react-multi-carousel'

import Layout from '../components/Layout'
import MobileLayout from '../components/MobileLayout'
import MobileCarousel from '../components/MobileCarousel'
import Details from '../components/Details'

import "react-multi-carousel/lib/styles.css";
import { color } from '../public/screensizes'


const CustomDot = ({ onClick, ...rest }) => {
  const { onMove, index, active, carouselState: { currentSlide, deviceType }} = rest;

  return(
    active ? <ActiveDot /> : <InactiveDot />
  )
}

const Home = () => (
  <>
    {/* <Layout company_name="Doghouse Gas & Oil" site_name="Anchor Battery">
      <Details name="Oil Tank 1"/>
      <Details name="Oil Tank 2"/>
      <Details name="Oil Tank 3"/>
      <Details name="Water Tank 1"/>
      <Details name="Water Tank 2"/>
      <Details name="Water Tank 3"/>
    </Layout> */}
    <MobileLayout company_name="Doghouse Oil & Gas" site_name="Anchor Battery">
      <MobileCarousel>
        <Details name="Oil Tank 1" />
        <Details name="Oil Tank 2" />
        <Details name="Water Tank 1" />
        <Details name="Water Tank 2" />
      </MobileCarousel>
    </MobileLayout>
  </>
)

export default Home


const ActiveDot = styled.button`
  height: 10px;
  width: 10px;
  margin-right: 5px;
  border-radius: 100%;
  border: none;
  background-color: ${color.jctOrange};
  position: static;
`

  const InactiveDot = styled.button`
  height: 10px;
  width: 10px;
